import React from "react";
import "./App.css";
import Nav from "./Nav";
import Home from "./Home";
import Location from "./Location";
import Reviews from "./Review";

import { Link, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div>

      <Nav />

      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/Location">
          <Location />
        </Route>
        <Route path="/Reviews">
          <Reviews />
        </Route>
      </Switch>

    </div>
  );
}

export default App;
